résumé:
Jorge Semprún fait le point sur la guerre d'Espagne à travers une série d'entretiens confrontant la mémoire des deux camps.
 Le documentaire s’articule en cinq chapitresﾠ :
 1. Février 1939. L’exil commenceﾠ;
 2. Juillet 1936. Guerre et Révolution en Espagneﾠ;
 3. 1931-1935. La République bourgeoise. Origines de la Guerre civileﾠ;
 4. L’Aide soviétique à l’Espagne républicaineﾠ;
 5. Mars 1939. La Guerre d’Espagne est finie.
